import React, { useEffect, useState } from "react";

const Badge = ({ children, className }) => {
  return (
    <span
      className={`inline-block px-2 py-1 text-sm font-semibold text-gray-800 bg-gray-200 rounded-full ${className}`}
    >
      {children}
    </span>
  );
};

const Card = ({ children, className }) => {
  return (
    <div className={`border rounded shadow-md ${className}`}>{children}</div>
  );
};

const CardContent = ({ children, className }) => {
  return <div className={`p-4 ${className}`}>{children}</div>;
};

export function ResultView() {
  const [percentage, setPercentage] = useState(0);

  useEffect(() => {
    const timer = setTimeout(() => {
      setPercentage(94); // Simulated IVF success rate
    }, 500);
    return () => clearTimeout(timer);
  }, []);

  return (
    <Card className="w-full max-w-3xl mx-auto ">
      <img sr></img>
      <CardContent className="p-6">
        <div className="relative min-h-[400px] bg-gradient-to-br from-gray-900 to-gray-800 rounded-lg overflow-hidden">
          <div className="absolute inset-0 bg-green-500/20" />
          <div className="relative z-10 p-6 text-white">
            <h2 className="text-2xl font-semibold mb-8">
              Your estimated IVF Success Rate is
            </h2>

            <div className="flex justify-center items-center mb-8">
              <div className="relative w-48 h-48">
                <svg className="w-full h-full" viewBox="0 0 100 100">
                  <circle
                    className="text-gray-700"
                    strokeWidth="8"
                    stroke="currentColor"
                    fill="transparent"
                    r="42"
                    cx="50"
                    cy="50"
                  />
                  <circle
                    className="text-green-500"
                    strokeWidth="8"
                    strokeLinecap="round"
                    stroke="currentColor"
                    fill="transparent"
                    r="42"
                    cx="50"
                    cy="50"
                    style={{
                      strokeDasharray: `${2 * Math.PI * 42}`,
                      strokeDashoffset: `${
                        2 * Math.PI * 42 * (1 - percentage / 100)
                      }`,
                      transition: "stroke-dashoffset 1s ease-in-out",
                    }}
                  />
                </svg>
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-center">
                  <span className="text-4xl font-bold">{percentage}%</span>
                  <Badge className="mt-2">Anonymous</Badge>
                </div>
              </div>
            </div>

            <p className="text-center text-lg">With 1 IVF Cycle</p>
          </div>
        </div>
      </CardContent>
    </Card>
  );
}
